import logo from './logo.svg';
import './App.css';
import { useEffect } from 'react';
import { useStore } from './store';
import { observer } from 'mobx-react-lite';
import axios from 'axios';

function App() {

  // stany i funkcje z magazynu
  const { appStore } = useStore();

  // dane z bazy
  useEffect(() => {
    axios.get(appStore.apiPath + '/Algorithm/GetAll')
      .then(response => {
        appStore.algorithms = response.data
      })
    axios.get(appStore.apiPath + '/FitnessFunction/Get')
      .then(response => {
        appStore.functions = response.data
      })
  }, [])

  handleFileChange = (event) => {

    console.log("Changing file");
    console.log(appStore.file);
    
    if (event.target.files && event.target.files.length > 0) {
      const selectedFile = event.target.files[0];
      appStore.file = selectedFile;
    }

    console.log(appStore.file);
    
  };

  return (
    <div className="App flex-box-main">

      <div className='flex-box-row'>

        <div className='flex-box-items'>
          <h2>Single</h2>
          <div className='item1'>
            <h3>Algorytmy: </h3>
            <table className="bp4-html-table .modifier">
              <thead>
                <tr>
                  <th>l.p.</th>
                  <th>nazwa</th>
                </tr>
              </thead>
              <tbody>
                {appStore.algorithms.map(algo => (
                  <tr key={algo.id}>
                    <td>{ }</td>
                    <td>{algo}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          <div className='item2'>
            <h3>Funkcje: </h3>
            <table className="bp4-html-table .modifier">
              <thead>
                <tr>
                  <th>l.p.</th>
                  <th>nazwa</th>
                </tr>
              </thead>
              <tbody>
                {appStore.functions.map(func => (
                  <tr key={func.id}>
                    <td>{ }</td>
                    <td>{func}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

        </div>


        <div className='flex-box-items'>
          <h2>Multi</h2>
          <div className='item1'>
            <h3>Algorytmy: </h3>
            <table className="bp4-html-table .modifier">
              <thead>
                <tr>
                  <th>l.p.</th>
                  <th>nazwa</th>
                </tr>
              </thead>
              <tbody>
                {appStore.algorithms.map(algo => (
                  <tr key={algo.id}>
                    <td>{ }</td>
                    <td>{algo}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          <div className='item2'>
            <h3>Funkcje: </h3>
            <table className="bp4-html-table .modifier">
              <thead>
                <tr>
                  <th>l.p.</th>
                  <th>nazwa</th>
                </tr>
              </thead>
              <tbody>
                {appStore.functions.map(func => (
                  <tr key={func.id}>
                    <td>{ }</td>
                    <td>{func}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

        </div>
      </div>

      <div className='flex-box-buttons'>
        <h1>Upload</h1>
        <div>
          <input type="file" />
          <button onChange={handleFileChange} onClick={() => appStore.handleUpload()}>Prześlij algorytm</button>
          {/* <button onChange={appStore.onChange} onClick={appStore.handleUpload}>Prześlij funkcje</button> */}
        </div>
      </div>

    </div>
  );
}

export default observer(App);
